// src/components/Footer.jsx
import React from "react";
import "../css/index.comp.css";
import logoGreen1x from "../img/logo-green-1x.png";
import logoGreen2x from "../img/logo-green-2x.png";
import logoGreenSmall1x from "../img/logo-green-small-1x.png";
import logoGreenSmall2x from "../img/logo-green-small-2x.png";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer__logo-box">
        <picture className="footer__logo">
          <source
            srcSet={`${logoGreenSmall1x} 1x, ${logoGreenSmall2x} 2x`}
            media="(max-width: 37.5em)"
          />
          <img
            srcSet={`${logoGreen1x} 1x, ${logoGreen2x} 2x`}
            alt="Full logo"
            src={logoGreen2x}
          />
        </picture>
      </div>
      <div className="row">
        <div className="col-1-of-2">
          <div className="footer__navigation">
            <ul className="footer__list">
              <li className="footer__item">
                <a href="#" className="footer__link">
                  Connect
                </a>
              </li>
              <li className="footer__item">
                <a href="#" className="footer__link">
                  Info
                </a>
              </li>
              <li className="footer__item">
                <a href="#" className="footer__link">
                  Category
                </a>
              </li>
            </ul>
          </div>
        </div>
        <div className="col-1-of-2">
          <p className="footer__copyright">
            Built by{" "}
            {/* <a href="#" className="footer__link">
              Jonas Schmedtmann
            </a>{" "}
            for his online course{" "}
            <a href="#" className="footer__link">
              Advanced CSS and Sass
            </a> */}
            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Officia,
            perferendis? Blanditiis enim sed quia dignissimos impedit numquam
            accusamus deserunt, animi deleniti, ratione, recusandae praesentium
            neque fugit distinctio. Dolores, dolor nemo! Repellat, dolorem
            incidunt nam quae minus deleniti facilis quam! Ratione officiis
            molestiae consequatur veniam?
          </p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
